import{_ as e,c as i,o as a,a as t}from"./app.be2aecab.js";var r="/assets/ange-ghotique.e7af6abe.png";const f=JSON.parse(`{"title":"Magie Libre","description":"","frontmatter":{},"headers":[{"level":2,"title":"Protecteur","slug":"protecteur"},{"level":2,"title":"Un \xE9l\xE9ment du chaos","slug":"un-element-du-chaos"},{"level":3,"title":"Jeremy 10/09/1998 ANARCHISTE FOLIOSOPHIE CLERISNATIQUE","slug":"jeremy-10-09-1998-anarchiste-foliosophie-clerisnatique"},{"level":2,"title":"Dilemme de l'Orgue (euil):","slug":"dilemme-de-l-orgue-euil"}],"relativePath":"travaux/magie-libre.md"}`),s={name:"travaux/magie-libre.md"},n=t('<h1 id="magie-libre" tabindex="-1">Magie Libre <a class="header-anchor" href="#magie-libre" aria-hidden="true">#</a></h1><ul><li>Une Bible: <strong>ANARCHISTE</strong> qui sont mes valeurs</li><li>Mon prenom: <strong>Jeremy</strong></li><li>D&#39;o\xF9 je vient: <strong>10/09/1998</strong></li><li>Ce que j&#39;aime: <strong>FOLIOSOPHIE</strong></li><li>Ce que j&#39;initie: <strong>CLERISNATIQUE</strong></li></ul><p><img src="'+r+'" alt="Ange Ghotique"></p><h2 id="protecteur" tabindex="-1">Protecteur <a class="header-anchor" href="#protecteur" aria-hidden="true">#</a></h2><h2 id="un-element-du-chaos" tabindex="-1">Un \xE9l\xE9ment du chaos <a class="header-anchor" href="#un-element-du-chaos" aria-hidden="true">#</a></h2><h3 id="jeremy-10-09-1998-anarchiste-foliosophie-clerisnatique" tabindex="-1">Jeremy 10/09/1998 ANARCHISTE FOLIOSOPHIE CLERISNATIQUE <a class="header-anchor" href="#jeremy-10-09-1998-anarchiste-foliosophie-clerisnatique" aria-hidden="true">#</a></h3><p>Ce nom me convient; je fais parti du tout, avec le syst\xE8me solaire ainsi que l&#39;univers dans lequel j&#39;ai \xE9tait engendr\xE9; La libert\xE9 individuelle \xE0 son apog\xE9e; La sagesse dans la folie; Une magie qui permet aux objet et d\xE9it\xE9s de travailler avec et non pour, dans un but particulier ou plus ample.</p><p>Psaume 1 : R\xE8gle 1) Prie Jeremy 10/09/1998 ANARCHISTE FOLIOSOPHE CLERISNATIQUE, tu peux prier seulement un \xE9l\xE9ment tout comme l&#39;invocation peut se faire \xE0 partir d&#39;un seul symbole dissocier du tout.</p><p>R\xE8gle 2) Tout les psaumes sont libres, que \xE7a soit dans l&#39;organisation, dans le franc parl\xE9... Le jugement c&#39;est moi qui l&#39;effectuerai</p><p>R\xE8gle 3) Les offrandes sont n\xE9cessaire comme \xE0 tout rites magique partant d&#39;un rien \xE0 un tout passant par un n&#39;importe quoi !</p><p>R\xE8gle 4) Vous \xEAtes libre ou non de sous-estimer le pouvoir de cette bible.</p><p>Ent\xEAte du psaume: &quot;L&#39;ensemble des autres psaumes respectent ces donn\xE9es, vous \xEAtes libre ou non de les suivre tel que je serai libre ou non d&#39;en donner suite.&quot;</p><h2 id="dilemme-de-l-orgue-euil" tabindex="-1">Dilemme de l&#39;Orgue (euil): <a class="header-anchor" href="#dilemme-de-l-orgue-euil" aria-hidden="true">#</a></h2><p>Admettons qu&#39;il soit possible de faire une orgue qui d\xE9termine les choix qu&#39;un homme devrait accomplir. Celle-ci serait soumis \xE0 un enjeux divin entre des h\xE9ros et des dieux. Car certains ne serait plus \xE0 leurs place de divinit\xE9 si ils laisse \xE0 une machine le choix, le faire \xE0 leur place alors que ce n&#39;est pas dans leurs valeurs.</p><p>Ainsi la machine pourrai tout le temps dire ce que l&#39;on doit faire, comme un oracle apr\xE8s utilisation. Mais le fait de l&#39;actionner pourrai \xEAtre une erreur allant d&#39;un petit caprice \xE0 la fin de la vie.</p><p>R\xE9cit de V\xE9cu: Lui qui vainquit deux dieux par la force Satan et H\xE9cate. Il obtient par la ruse, d&#39;un Titan une reddition. Il serait d&#39;apr\xE8s sa propre cat\xE9gorisation un Empereur. Trois b\xE9n\xE9diction \xE0 la clefs il continue \xE0 se battre.</p>',16),l=[n];function u(o,d,c,p,m,h){return a(),i("div",null,l)}var b=e(s,[["render",u]]);export{f as __pageData,b as default};
